import React from "react";
import { Box, Center } from "@chakra-ui/react";

const Quiz = () => {
    return (
        <Box bg="yellow" w="100%">
            <Center h="100%" w="70%">
                <Box>This is message 1</Box>
            </Center>
        </Box>
    );
};

export default Quiz;
